import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div class="ui three item menu">
      <Link to="/jobs/recent" className="item">
        Recent Search
      </Link>
      <Link to="/jobs/current" className="item">
        Filtered Stream
      </Link>
      <Link to="/jobs/annotations" className="item">
        Filtered Stream + Annotations
      </Link>
    </div>
  );
};

export default Navbar;
